import '../../stylesheets/WaiterView/WaiterMainView.css';

const TableRowSelect = ({data,delFromOrder}) => {
    let {id,name,price, quantity} = data;
    const subtotal = price*quantity;
    return (
    <tbody>
    <tr>
    <th><h3>{name}</h3></th>
    <th><h5>{quantity}</h5></th>
    <th>${subtotal}</th>
    <th><button onClick={() => delFromOrder(id)}><i className="icon-minus"></i>ELIMINAR UNO</button>
    <button onClick={() => delFromOrder(id, true)}><i className="icon-trash"></i>ELIMINAR Todo</button>
    </th>
    </tr>
    </tbody>
    )
}
export default TableRowSelect;
